Deep 2002 dive into the making of my first album. “Is This Hollywood” I wrote about moving to LA from NYC and the big wtf in my head. I didn’t know how to drive so I trekked everywhere on a mountain bike. Was cycling up La Cienega (the massive hill part) and this melody hit me hard. Called my dear friend @shellypeiken (who I had written a lot with) and we dug in. It flooded out of us. We finished it with @john_shanks who was producing in our cave at Henson Studios. Here is Abe Laboriel, Jr. slaaaying it on drums and me doing vocals. I haven’t seen this footage til now and I’m absorbing this on expected levels. Look at this kid! She is just figuring it out. Still is. Again me = 🤯 

