Last night’s studio adventure. “Rocketeer” means so much to me that I recorded 2 different arrangements of it for 2 different albums I have coming out. @loukboudesteijn wrote a gorgeous hymn on guitar and the lyric hit me in 20 minutes flat. This rarely happens with me so when it does, I hold onto it like crazy and usually don’t change a single thing. I wish there was a potion I could drink for this. 

I wrote it about being a rocketeer - the one who leaves for the adventure they’re meant to journey on, shooting off into space and time, leaving everyone behind. But I also wrote it from the perspective of the one who is left behind. Playing it with these guys last night opened that valve to my heart even more than expected. 

Arranged, co-written and played by @loukboudesteijn who blows me away on a daily basis. My Team Brass slaying it: 

