Today wraps my 3-week + 3-nation tour of singing at the loveliest venues and giving masterclasses in Denmark, Netherlands and USA with @heyness and and our project The Guests. 

The musical brain and thirst for knowledge keeps deepening over here. And that’s really nice to know. To be inspired on pretty much a daily basis in this kind of climate (as you can see from my raggedy under-slept post the other day) is something I haven’t felt for a good stretch. To have this somewhat thick skin to endure strange circumstances in this business yet still be porous and open to ALL THINGS NEW is something I like about myself these days. Some days up, some down, but I’m up for the challenge. Want to be pushed. Need it. Want to learn and absolutely must sing. Knowing that about myself feels pretty stinkin’ good. 

Thanks to these lovely humans and venues for making all the dots connect for Henry and I and we will see you again! With super 🫶🫶🫶🫶: 

